
app.factory("dataService", function(){

  // products database initial values data
  const initData = {
    products: [
        {
          id: '123456789123',
          name: "Item 1 --name",
          price: 210,
          description: "desc__LOUNGE 10 BLACK7",
          image: "data:image/png;base64,"
        },
        {
          id: '234567891234',
          name: "Item 2 --name",
          price: 230,
          description: "desc__LOUNGE 12 BLACK7",
          image: "data:image/png;base64,"
        },
        {
          id: '345678912345',
          name: "Item 3 --name",
          price: 230,
          description: "desc__LOUNGE 12 BLACK7",
          image: "data:image/png;base64,"
        },
        {
          id: '456789123456',
          name: "Item 4 --name",
          price: 290,
          description: "desc__LOUNGE 12 BLACK7",
          image: "data:image/png;base64,"
        },
        {
          id: '567891234567',
          name: "Item 5 --name",
          price: 330,
          description: "desc__LOUNGE 12 BLACK7",
          image: "data:image/png;base64,"
        },
        {
          id: new Date().getTime().toString(),
          name: "Item 6 --name",
          price: 110,
          description: "desc__LOUNGE 13 BLACK7",
          image: "data:image/png;base64,"
        }
    ]
  }; // eof const data.


  const lsLen = localStorage.length;
  let dataBase;

  if (lsLen > 0){ // if LS has any data.

      if (localStorage.getItem("products") !== null){
        dataBase = JSON.parse(localStorage.getItem("products"));
      }
  } else { // EOF if LS has any data.
      // set data from local variable
      dataBase = initData.products;
      localStorage.setItem('products', JSON.stringify(dataBase));
  }

  return {
    data: dataBase,

    // writing data to LocalStorage:
    updateStorage (obj){
      localStorage.setItem('products', JSON.stringify(obj));
      return false;
    },

    // getting data from LocalStorage:
    getData (){ //
      return JSON.parse(localStorage.getItem('products'))
    },

    // get product data from storage by its id
    getProduct(id){
      let product;
      dataBase.forEach((elem, index) => {
        if (elem.id === id) {
          product = dataBase[index]; // { ...elem };
        }
      });
      // debugger

      // return object with product id
      return product;
    },

    // add new data to local 'database' && to localStorage
    addToBase(item){
      dataBase.push(item);
      this.updateStorage(dataBase);
      return false;
    }
  };


}); // EOF factory
